    timestamp TIMESTAMP
);

CREATE TABLE phishing_attacks (
    attack_id INT PRIMARY KEY,
    timestamp TIMESTAMPTZ
);

CREATE TABLE peak_engagement_times (
    engagement_id INT PRIMARY KEY,
    attack_id INT,
    timestamp TIMESTAMPTZ,
    engagement_level INT
);

CREATE TABLE phishing_attacks (
    id INT PRIMARY KEY,
    timestamp TIMESTAMP,
    success BOOLEAN
);

CREATE TABLE peak_engagement_times (
    id INT PRIMARY KEY,
    engagement_time TIMESTAMP,
    attack_id INT
);

CREATE TABLE attacker_details (
    id INT PRIMARY KEY,
    attacker_name VARCHAR,
    location VARCHAR
);

CREATE TABLE peak_engagement_times (
    engagement_id INT PRIMARY KEY,
    engagement_timestamp TIMESTAMP,
    engagement_duration INTERVAL
);

CREATE TABLE attack_analysis (
    analysis_id INT PRIMARY KEY,
    attack_id INT,
    engagement_id INT,
    peak_engagement_time TIMESTAMP
);

CREATE TABLE attacker_clients (
    client_id INT PRIMARY KEY,
    client_ip VARCHAR(255),
    client_location VARCHAR(255),
    last_activity_timestamp TIMESTAMP
);

CREATE TABLE victim_emails (
    email_id INT PRIMARY KEY,
    email_address VARCHAR(255),
    engagement_count INT,
    last_engagement_timestamp TIMESTAMP
);
